/**
 * Create a OCC path and append all Parameters from the request eq. /path?param=value.
 *
 * @param path
 *           the path to use
 * @param request
 *           the request to get Parameter from
 * @param params
 *           additional parameters to add to the request
 * @return OCC path as a String
 */
protected WagoOccRequest createOccRequest(final String path, final HttpServletRequest request,
		final Map<String, String[]> params)
{
	final String url = getOccApiPath() + path;
	return new WagoOccRequestBuilder(url)
			.addParameters(request.getParameterMap())
			.addParameters(params)
			.addLang(getCurrentLanguage())
			.addFullFields()
			.build();
}

protected String getOccApiPath()
{
	return OCC_API_URL_PATH + getCmsSiteService().getCurrentSite().getUid();
}

