when(request.getServletPath()).thenReturn("/path");

handler.beforeView(request, response, modelAndView);

final Set<Map<String, String>> model = getMapFromModel();
assertEquals(2, model.size());
final Map<String, String> deMap = getByIsoCode(model, "de");
assertNotNull(deMap);
assertEquals("DE", deMap.get(WagoLanguageSelectionBeforeViewHandler.NAME_MAP_KEY));
assertEquals("/store-de/path", deMap.get(WagoLanguageSelectionBeforeViewHandler.URL_MAP_KEY));

when(component.getDynamicVisibility()).thenReturn(true);

//Slot Content
final ContentSlotData sectionSlotData = mock(ContentSlotData.class);
when(sectionSlotData.getPosition()).thenReturn(SECTION_SLOT_ID);
final ContentSlotModel sectionSlotModel = mock(ContentSlotModel.class);
when(sectionSlotData.getContentSlot()).thenReturn(sectionSlotModel);
when(sectionSlotModel.getCmsComponents()).thenReturn(Arrays.asList(mock(AbstractCMSComponentModel.class), component));
